import React from 'react';

import Menu from './menu';
import Tile from './tile';


class Layout extends React.Component {
  render() {
    return (
      <div>
        <Menu />
        <Tile title="potato"/>
        <Tile title="salad"/>
        <Tile />
      </div>
    )
  };
}

export default Layout;
